import React from 'react'
import Product from './Product'
import productItems from "./productApi";
import Hottest from './hottest'
import hottest from './hottestApi'

function Home() {

    return (
        <div>
            <div className="container ">
                <div>
                    {hottest.slice(0, 3).map(({
                        id,
                        title,
                        image,
                        pricing,
                        alt,
                        qty,
                    }) => (
                        <Hottest
                            key={item.id}
                            title={item.title}
                            pricing={item.pricing}
                            qty={item.qty}
                            image={item.image}
                        />
                   )) }
                </div>

                    <div >
                        {productItems.map((item) => (
                            <Product

                            key ={item.id}
                            title={item.title}
                            pricing={item.pricing}
                            qty ={item.qty}
                            image={item.image}
                       />)) }


                </div>






       </div></div>

    )
}

export default Home
